Content:
@ekast23 A train is gonna hit 5 men tied to its tracks. You have a moral dilemma between saving 1 man vs 5 men.

Now replace the 1 vs 5 with 10.000 people in power vs 280.000.000 normal citizens.

You have to choose because the train impact is real and approaching fast. It will be a tragedy. Will you push the lever and switch the impact to hit 1 man or let it run over 5 men? What would you choose?
